import React from 'react';
import { Container, City } from './WeatherCard.styled';

function WeatherCard({ city }) {

  return (
      <Container>
        <h1>{city.city}</h1>
        <City>15:45</City>
        <p>21</p>
        <p>Cloudy</p>
        <p>H:15 L:7</p>
      </Container>
  );
}

export default WeatherCard;
